import styles from './CTAContainer.module.css';

const CTAContainer = () => {
    return (
        <div className={styles.cta}>
            <img className={styles.bgIcon} alt="" src="/bg5.svg" />
            <div className={styles.title}>
                <div className={styles.weveHelpedBrandsContainer}>
                    <span className={styles.weveHelpedBrandsContainer1}>
                        <p className={styles.weveHelpedBrands}>We've helped brands of all kinds and businesses</p>
                        <p className={styles.weveHelpedBrands}>of every size grow their online revenue</p>
                    </span>
                </div>
            </div>
            <div className={styles.areYouReady}>
                Are you ready to start your project? Contact us today and get started!
            </div>
            <button className={styles.button}>
                <div className={styles.contactUs}>Contact Us</div>
            </button>
        </div>
    );
};

export default CTAContainer;
